window.bookSummaryJSON = "<p>Imposter syndrome is a phenomenon in which people believe they are not worthy of success. They convince themselves that they have done well due to luck and are terrified their shortcomings will eventually be exposed, making it impossible to enjoy their accomplishments.</p> <p><i>The Imposter Cure </i>explores the psychological impact of imposter syndrome and exposes the secrets fears and insecurities felt by millions of men and women. Dr Jessamy Hibberd provides sound expert advice to help the listener better understand the problem and overcome it, so they think differently, gain self-belief and learn to see themselves as others do.&nbsp;</p> <p>Filled with case studies to bring the concepts alive and packed with strategies to increase confidence, this book is a must-listen for anyone who has struggled with their achievements.</p>"; 
